import React from "react"
import { useNavigate } from 'react-router-dom'
import  './TattooCard.css'
import { useSelector } from "react-redux"



const TattooCard = ({userName,subject}) => {
    const navigate = useNavigate()

    return(
        <div className="tattooCard">
            <h3>Tattoo subject</h3>
            <img className='img' src={"https://post.healthline.com/wp-content/uploads/2020/03/woman-demonstrating-just-finished-creative-arrow-tattoo-on-her-hand-732x549-thumbnail.jpg"} onClick={()=>navigate("/profilePage")}></img>

        </div>
    )
}
export default TattooCard
